import React from "react";

import './ContextMenu.scss';

const ContextMenu = ({props}) => {
    console.log(props)
    const style = {
        top: props.x,
        left: props.y
    }
    return (
        <div 
            className="context-menu"
            onContextMenu={(e) => e.preventDefault()}
            style={style}>
                <div>Change Image</div>
                <div>Duplicate</div>
                <div>Change Image</div>
        </div>
    );
}

export default ContextMenu;
